package com.creek.dial

import android.os.Build
import androidx.annotation.RequiresApi
import com.example.mylibrary.CreekManager
import com.example.proto.Enums
import com.example.proto.Weather
import com.google.gson.Gson
import com.google.protobuf.ByteString
import java.time.LocalDateTime
import java.time.format.DateTimeFormatter


class WeatherCommand {



    @RequiresApi(Build.VERSION_CODES.O)
    fun setWeather(){

        val gson = Gson()
        val weatherResponse = gson.fromJson(jsonString, WeatherResponse::class.java)
         var operate = Weather.protocol_weather_operate()
         operate.switchFlag = true
         var item = Weather.protocol_weather_detail_data_item()
         val dateString = weatherResponse.current?.last_updated
         val formatter = DateTimeFormatter.ofPattern("yyyy-MM-dd HH:mm")
         val dateTime = LocalDateTime.parse(dateString, formatter)
         item.month = dateTime.monthValue
         item.day = dateTime.dayOfMonth
         item.hour = dateTime.hour
         item.min = dateTime.minute
         item.week = dateTime.dayOfWeek.value
        item.cityName = ByteString.copyFrom(weatherResponse.location.country.toByteArray())
        item.addAllAtmosHpaItems(listOf(111,111,111))


         ///Here you convert your weather type data into the SDK weather type
         var weatherType = Enums.weather_type.SUNNY
         if (weatherResponse.current?.condition?.code == 1000){
             weatherType = Enums.weather_type.SUNNY
         }else if (weatherResponse.current?.condition?.code == 1033){
             weatherType = Enums.weather_type.HAZE
         }else{
             weatherType = Enums.weather_type.SUNNY
         }
         item.weatherType = weatherType

        ///Set the basic weather information for the current time
         item.curTemp = weatherResponse.current?.temp_c?.toInt()?: 0
         item.curMaxTemp = weatherResponse.current?.temp_c?.toInt()?: 0
         item.curMinTemp = weatherResponse.current?.temp_c?.toInt()?: 0
         item.airQuality = weatherResponse.current?.air_quality?.pm10?.toInt()?: 0
         ///省略************************


        ///Set weather information for the next 48 hours
        val next48Hours = mutableListOf<Hour>()
        outer@ for (forecastDay in weatherResponse.forecast.forecastday) {
            for (hour in forecastDay.hour) {
                if (hour.time_epoch > weatherResponse.current.last_updated_epoch) {
                    next48Hours.add(hour)
                    if (next48Hours.size >= 48) break@outer
                }
            }
        }
        ///Reassemble the data obtained for the next 48 hours into the SDK data format
        val next48HoursweatherItem = mutableListOf<Weather.protocol_weather_hour_weather_item>()
        next48Hours.forEachIndexed { index, hour ->
            val weatherItem = Weather.protocol_weather_hour_weather_item()
            var weatherType2 = Enums.weather_type.SUNNY
            if (hour.condition.code == 1000){
                weatherType2 = Enums.weather_type.SUNNY
            }else if (hour.condition.code == 1033){
                weatherType2 = Enums.weather_type.HAZE
            }else{
                weatherType2 = Enums.weather_type.SUNNY
            }
            weatherItem.weatherType = weatherType2
            weatherItem.temperature = hour.temp_c.toInt()
            next48HoursweatherItem.add(weatherItem)
        }
        item.addAllHoursWeatherItems(next48HoursweatherItem)


        ///*****************************
        ////If you have more weather data, you can continue to add it in the same way as above.
        item.uvItemsList
        item.moonItemList
        item.sunriseItem
        item.atmosHpaItemsList
        ///*****************************

        operate.addDetailDataItem(item)

        ///设置天气
        CreekManager.sInstance.setWeather(model = operate, success = {

        }, failure =  {
            code, message ->
        })





    }


